import axios from 'axios';

const BASE_URL = 'http://localhost:8080/api/user';

export const getUserBalance = (userId) =>
  axios.get(`${BASE_URL}/balance`, { params: { userId } });

export const resetUser = (userId) =>
  axios.delete(`${BASE_URL}/reset`, { params: { userId } });
